import { Typography, Button, Grid } from "@mui/material";
import { Box } from "@mui/system";
import { Theme } from "../others/Theme";

export const HelloBlock = () => {

  const pages = [
    { text: "EXPLORE", href: "/" },
    { text: "UPLOAD", href: "/create" },
  ];

  return (
    <Grid container spacing={3} justifyContent="center">
      <Grid item xs={11}>
        <Box>
          <Typography align="Center" variant="h5">
            Hello, It's babai NFT marketplace
          </Typography>
        </Box>
      </Grid>
      <Grid item xs={11}>
        <Typography align="Center" variant="h6">
          Hello, It's my marketplace_project
        </Typography>
      </Grid>
      <Grid item xs={11}>
        <Typography align="Center">
          random text random" text random text random text
        </Typography>
      </Grid>
      <Grid>
        <Box
          sx={{
            mt: "1rem",
            display: "flex",
            alignContent: "space-between",
          }}
          align="Center"
        >
          {pages.map((page) => (
              <Button
                sx={{
                  backgroundColor: Theme.palette.otherColor.light,
                  color: "#888",
                  "&:hover": {
                    backgroundColor: Theme.palette.otherColor.main,
                  },
                }}

                href={page.href}
              >
                {page.text}
              </Button>

            ))}
          <Button
           sx={{ mr: "1.5rem" }} 
           variant="contained"
           href={page.href}>
            {page.text}
          </Button>
          <Button variant="contained">Explore</Button>
        </Box>
      </Grid>
    </Grid>
  );
};
